import './App.css';
import React, {Component} from 'react';
import PC from './PC/PC';
import Mob from './Mob/Mob';
import "@fontsource/jura"; // Defaults to weight 400
import "@fontsource/jura/400.css"; // Specify weight

class App extends Component{
  constructor(props){
    super(props)
  }

  componentDidMount(){
    // console.log(this.props.app.port)
    // axios.get('http://localhost:3010/api/test').then(response => {
    //   console.log(response)
    // })
  }

  isMobile () {
    let mob_arr = [
      "/Android/i", "/BlackBerry/i", "/iPhone|iPad|iPod/i", "/Opera Mini/i", "/IEMobile/i"
    ]
    mob_arr.forEach(item => {
      console.log(navigator.userAgent.match(item))
      if (!navigator.userAgent.match(item)){
        return true 
      }
    })
    return false
  }

  render(){
    console.log(this.isMobile())
    let isPC = this.isMobile()
    return(
      <div className='App'>
        {isPC?<PC/>:<Mob/>}
      </div>
    )
  }
}


export default App
